.systemConfig {
  padding: 0;
  >>> .el-card__header {
    padding: 6px 20px;
  }
  >>> .el-tabs--border-card {
    box-shadow: none;
    height: calc(100vh - 120px);
  }
  >>> .el-tabs--border-card > .el-tabs__content {
    padding: 30px;
  }
  .saveBtn {
    width: 100px;
  }
  .el-table >>> th {
    line-height: 23px;
  }
  .thirdTab >>> .el-tabs__content {
    height: 100%;
    .el-tab-pane {
      height: auto;
    }
  }
  .tip {
    font-size: 14px;
    color: #a5a5a5;
  }
  .lockTime {
    line-height: 32px;
    padding-right: 12px;
    color: #606266;
    font-size: 14px;
  }
  .unit {
    padding-right: unset;
    padding-left: 12px;
  }
  .img-list {
    display: flex;
    >>> .singleImg-container {
      margin-right: 20px;
      :last-child {
        margin-right: 0;
      }
    }
  }
  .secondTab {
    >>> .el-tabs__content {
      height: 100%;
    }
  }
}
.add-main {
  display: flex;
  align-items: center;
  justify-content: space-between;
  .add-item {
    width: 450px;
    height: 100px;
    display: flex;
    align-items: center;
    cursor: pointer;
    &.add-item-sys {
      .add-icon {
        background: #75d8f791;
        color: #08c0f8;
      }
    }
    .add-icon {
      width: 56px;
      height: 56px;
      margin-right: 10px;
      background: #cefae2;
      border-radius: 50%;
      color: #0eac5c;
      flex-shrink: 0;
      font-size: 30px;
      line-height: 56px;
      text-align: center;
    }
    .add-button {
      margin-left: 80px;
    }
    .add-icons {
      width: 56px;
      height: 56px;
      margin-right: 10px;
      background: #cefae2;
      border-radius: 50%;
      color: #0eac5c;
      flex-shrink: 0;
      font-size: 30px;
      line-height: 56px;
      text-align: center;
    }
    .add-txt {
      height: 56px;
      P {
        line-height: 28px;
      }
      .add-title {
        font-size: 18px;
        font-weight: bold;
      }
      .add-desc {
        color: #8d8989;
        font-size: 12px;
        width: 150px;
      }
    }
  }
}
>>> .sync-dialog .el-dialog__body {
  padding: 20px 50px !important;
